INSERT INTO `maintexts` (`id`, `name`, `body`, `url`, `category_id`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Main', ' <div class=\"row section_text stext\">\n                   \n                    <div class=\"col-md-12\">\n                        <h1 class=\"stext_h1\">Почему заказать сайт лучше у нас?</h1>\n                          <p class=\"stext_p\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Мы предлагаем профессиональную разработку сайтов в Минске и по всей Беларуси. Только за 2017 год наши специалисты реализовали проекты в более, чем 30 тематиках: авто (продажа, трансфер, выкуп), страхование, кредитный консалтинг, услуги в сфере красоты, воротные системы, смазочные материалы, мебель, окна, нагревательные системы и многие другие.Наши Клиенты предлагают рынку достойные продукты и услуги и гордятся своим делом. А мы гордимся реализованными для них проектами. Более 90% разработанных в агентстве сайтов остаются в на технической поддержке и SEO-продвижении.</span></p>\n                    </div>\n                    \n                </div>\n\n               \n                <div id=\"section_img\" class=\"row text-center\">\n\n                    <div class=\"col-md-4\">\n                        <h1 class=\"item_h1\">Бесплатный домен на <br> 1 год</h1>\n                        <img class=\"img-responsive link_img-main\" src=\"(/img/lending-minsk.png)\" alt=\"lending-minsk\">\n                    </div>\n\n                    <div class=\"col-md-4\">\n                        <h1 class=\"item_h1\">Настройка контекстной рекламы</h1>\n                        <img class=\"img-responsive link_img-main\" src=\"(/img/page.png)\" alt=\"page\">\n                    </div>\n\n                    <div class=\"col-md-4\">\n                        <h1 class=\"item_h1\">Визуальный редактор содержимого</h1>\n                        <img  class=\"img-responsive link_img-main\" src=\"(/img/lending.png)\" alt=\"lending\">\n                    </div>\n                    \n                      <div class=\"col-md-4\">\n                        <br><h1 class=\"item_h1\">Экономия Ваших денег и времени</h1>\n                        <img class=\"img-responsive link_img-main\" src=\"(/img/landing-minsk.png)\" alt=\"landing-minsk\">\n                    </div>\n                    \n                      <div class=\"col-md-4\">\n                        <br><h1 class=\"item_h1\">2 недели технической поддержки</h1>\n                        <img class=\"img-responsive link_img-main\" src=\"(/img/odnostranichnyj-sajt.png)\" alt=\"odnostranichnyj-sajt\">\n                    </div>\n                    \n                      <div class=\"col-md-4\">\n                        <br><h1 class=\"item_h1\">Подключение <br> SSL-сертификата</h1>\n                        <img class=\"img-responsive link_img-main\" src=\"(/img/minsk.png)\" alt=\"minsk\">\n                    </div>\n\n                </div>\n\n                <div class=\"row section_text stext\">\n                    \n                    <div class=\"col-md-12\">\n            \n                        <p class=\"stext_p\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Чем бы вы ни занимались, ваша компания уникальна. И задача наших специалистов - показать это интернет-пользователю и сделать так, чтобы ваш потенциальный Клиент стал вашим постоянным Клиентом. Разработанный профессиональной командой сайт поможет грамотно презентовать компанию и станет незаменимым инструментом для продвижения вашего бизнеса в интернете. Характеристики наших сайтов: </span></p>\n                        \n                        <ul style=\"padding-left:20px\">\n                        <li type=\"disc\" class=\"stext_p\">адаптивный, удобно пользоваться с любого мобильного и ТВ-устройства;</li>\n                        <li type=\"disc\" class=\"stext_p\">уникальный дизайн;</li>\n                        <li type=\"disc\" class=\"stext_p\">подходит для дальнейшего продвижения в поисковых системах (SEO).</li>  \n                        </ul>\n                        \n                        <br><p class=\"stext_p\"><span>&nbsp;&nbsp;&nbsp;&nbsp;С 2016 года мы также можем предложить готовые решения, которые дорабатываются согласно поставленным задачам. Стоимость работ зависит от сложности проекта, поэтому для оценки рекомендуем заполнить бриф. Обращайтесь к консультантам нашего агентства по электронной почте <a href=\"mailto:vyts_vyts@mail.ru\">vyts_vyts@mail.ru </a>или указанным телефонам.</span></p>\n                        \n                    </div>\n                    \n                       <div class=\"col-md-12\">\n                        <br><div><a class=\"btn btn-primary btn-block links_menu\" href=\"#\">Бриф</a></div>\n                       </div>\n                    \n                </div>', 'index', NULL, NULL, 1, '2018-10-15 09:06:51', '2018-10-15 09:06:51'),
(2, 'Design', ' <div class=\"row section_text stext\">\r\n                   \r\n                    <div class=\"col-md-12\">\r\n                        <h1 class=\"stext_h1\">дизайна сайта</h1>\r\n                        <p class=\"stext_p\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Ни один бизнес не может успешно развиваться, не имея собственного присутствия в глобальной сети. Сайт компании способен передать основной маркетинговый посыл, будучи идеальной площадкой для продажи товаров и услуг, а также продвижения идей. Самое время привлечь к себе внимание, наладить диалог с целевой аудиторией, показать динамику своего развития и, наконец, добиться стабильного роста. Креативные концептуальные идеи веб-дизайна дают нашим заказчиками конкурентное преимущество и инструментарий для представления и продвижения собственного бизнеса. Вы можете заказать дизайн веб сайтов от ведущей белорусской студии разработчиков. Вы в двух шагах от решения этой задачи: наша компания сделает всё, что для этого нужно. Наши дизайнеры рисуют от руки, что гарантирует 100% уникальность. Уровень работ вы можете оценить, посетив раздел <a href=\"#\">проекты</a>. Воспользуйтесь нашей энергией! Обратитесь к нам сейчас. Ваш будущий сайт будет не просто хорошим. Он будет самым лучшим!</span></p>\r\n                    </div>\r\n                    \r\n                </div>\r\n\r\n               \r\n                <div id=\"section_img\" class=\"row text-center\">\r\n\r\n                    <div class=\"col-md-4\">\r\n                        <h1 class=\"item_h1\">First</h1>\r\n                        <img class=\"img-responsive link_img\" src=\"public/img/pic_1.png\" alt=\"pic1\">\r\n                    </div>\r\n\r\n                    <div class=\"col-md-4\">\r\n                        <h1 class=\"item_h1\">Second</h1>\r\n                        <img class=\"img-responsive link_img\" src=\"public/img/pic_2.png\" alt=\"pic1\">\r\n                    </div>\r\n\r\n                    <div class=\"col-md-4\">\r\n                        <h1 class=\"item_h1\">Third</h1>\r\n                        <img class=\"img-responsive link_img\" src=\"public/img/pic_3.png\" alt=\"pic1\">\r\n                    </div>\r\n\r\n                </div>\r\n\r\n                <div class=\"row section_text stext\">\r\n                   \r\n                    <div class=\"col-md-12\">\r\n                        <h1 class=\"stext_h1\">создание эффективных баннеров</h1>\r\n                        <p class=\"stext_p\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Одним из самых эффективных рекламных носителей в интернете является баннер. Глядя на него, потенциальный клиент сразу может составить первое впечатление о поставщике услуг или продавце. Особенностью баннера является то, что он отражает суть предложения вашей компании. <br>&nbsp;&nbsp;&nbsp;&nbsp;Разработка баннера должна осуществляться таким образом, чтобы в конечном итоге он привлекал внимание клиента, положительно действуя на его сознание. Размещая баннеры на веб-страницах, вы тем самым сообщаете потенциальным клиентам о наличии нового предложения вашей компании, ставите акцент на ее товарах и услугах, направляете пользователей на нужные вам страницы, мотивируя их воспользоваться предложенной услугой или купить предлагаемый товар.\r\n                        </span></p>\r\n                    </div>\r\n                    \r\n                    <div class=\"col-md-12\">\r\n                        \r\n                        <br><br><div><a class=\"btn btn-primary btn-block links_menu\" href=\"#\">Заказать</a></div>\r\n                        \r\n                    </div>\r\n                    \r\n                </div>', 'design', NULL, NULL, 1, '2018-10-15 09:23:02', '2018-10-15 09:23:02'),
(3, 'Contact', '               <div class=\"row section_text stext\">\r\n                   \r\n                    <div class=\"col-md-12\">\r\n                        <h1 class=\"stext_h1\">Частное предприятие \"SV\"</h1>\r\n                        \r\n                          <div class=\"col-md-6 text-center\">\r\n                        <iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d3949.967931637851!2d27.684244776685386!3d53.937695501743974!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sru!2sby!4v1539598138665\" width=\"400\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>\r\n                         </div>\r\n                        \r\n                        <div id=\"header_adress\" class=\"col-md-6 text-center\">\r\n                             <address style=\"color: #888;\">\r\n                                <h2 class=\"adress_h2\">Наш офис:</h2>\r\n                                <p class=\"adress_p\">г.Минск ул.Шугаева д.99</p>\r\n                                <p class=\"adress_p\">+375(29)543-23-43(мтс)</p>\r\n                                <p class=\"adress_p\">+375(29)543-24-42(велком)</p>\r\n                                </address>\r\n                         </div>\r\n                         \r\n                         <div class=\"col-md-6 text-center\">\r\n                            <br><br><h2 class=\"adress_h2\" style=\"color: #888;\">Мы в соцсетях:</h2>\r\n                            <span class=\"col-md-2 col-xs-2 col-sm-2\"></span>\r\n                            <a class=\"col-md-3 col-xs-3 col-sm-3\" title=\"vk\" href=\"http://vk.com\"><img class=\"img-responsive\" src=\"public/img/vk.png\" alt=\"vk\"></a>\r\n\r\n                            <a class=\"col-md-3 col-xs-3 col-sm-3\" title=\"fb\" href=\"http://facebook.com\"><img class=\"img-responsive\" src=\"public/img/fb.png\" alt=\"fb\"></a>\r\n\r\n                            <a class=\"col-md-3 col-xs-3 col-sm-3\" title=\"telegram\" href=\"http://twitter.com\"><img class=\"img-responsive\" src=\"public/img/tw.png\" alt=\"twitter\"></a>\r\n\r\n                         </div>\r\n                         \r\n                    </div>\r\n\r\n                </div>', 'contact', NULL, NULL, 1, '2018-10-15 09:23:35', '2018-10-15 09:23:35');

