INSERT INTO `newzs` (`id`, `title`, `description`, `body`, `img`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Рейтинг Байнета 2017 ', 'Показатель нашей работы', 'Предпраздничное настроение этого года для нас задают результаты \"Рейтинга Байнета\"! \r\n\r\nПоказателем лучшего результата нашей работы мы считаем благодарность клиентов, их повторное обращение за дополнительными услугами или их рекомендации о нас своим друзьям и партнерам.\r\n\r\nУчастие в Рейтинге Байнета 2017 для нас явилось возможностью увидеть объективные итоги по проектам, узнать честное мнение о степени нашего профессионализма, и, конечно, еще раз напомнить о себе белорусскому рынку. Не станем скрывать, что всегда и во всем хочется быть первыми. Наверное, с таким желанием на церемониию проекта «Рейтинг Байнета» пришли представители каждой компании-участника. По крайней мере, надеемся на это. Ведь именно желание каждой компании победить в Рейтинге создает здоровую конкуренцию и позволяет удивлять клиентов - в самом хорошем смысле этого слова.\r\n\r\nМы понимаем, что нам есть к чему стремиться.\r\nНо мы искренне рады тому, что имеем сейчас!\r\nСпасибо!\r\n\r\nВпереди длинный и увлекательный путь!\r\n\r\nНескромно ждем поздравлений:\r\n\r\n1 МЕСТО как лучшему (!) SMM агентству\r\n3 МЕСТО среди лучших digital-агентств\r\n5 МЕСТО среди лучших WEB-студий\r\nХорошая работа = прекрасное настроение, удовольствие от мероприятия! \r\n', , 1, '2018-10-29 08:51:20', '2018-10-29 08:51:20');
INSERT INTO `newzs` (`id`, `title`, `description`, `body`, `img`, `user_id`, `created_at`, `updated_at`) VALUES
(2, 'Что такое юзабилити?', 'Юзабилити в современном веб-дизайне является способность сайта быть удобным', 'Синонимом юзабилити в современном веб-дизайне является способность сайта быть удобным, понятным и логичным для пользователя. По сути, это оценка, которую дает посетитель веб-страницы после опыта взаимодействия с проектом.\r\n\r\nГлавное для разработчиков – сделать сайт как можно более простым и удобным. Важно убедиться, что все информация читаема с визуальной точки зрения, ее легко найти, а от использования возникают только положительные эмоции.\r\n\r\nЮзабилити – это намного больше, чем красивое оформление текста и правильное расположение Call-to-Action (от англ. «призыв к действию») кнопок. Чтобы добиться необходимого результата, нужно принимать во внимание несколько критериев оценки элементов веб-сайта. Все должно быть оптимизировано под потребности и требования целевой аудитории. По результатам ежегодного отчета Global Digital на начало 2018 года в мире насчитывается 4,021 миллиарда Интернет-пользователей, а это больше половины населения всей планеты. Только за последний год количество активных пользователей увеличилось на 250 миллионов человек. Возможностями мобильного Интернета пользуются 3,722 миллиарда, а социальными сетями – 3,196 миллиарда человек. Среднестатистический пользователей проводит в сети 6 часов ежедневно, причем в лидерах не жители США или Китая, а Таиланд – 9 часов 38 минут. Без сомнений Интернет – это колоссальный источник новых клиентов для любой компании. Очевидно, что если интерфейс сайта для пользователя удобен и его ничего не раздражает, то он относится к компании лояльно и становится потенциальным клиентом.', , 1, '2018-10-29 08:54:37', '2018-10-29 08:54:37');
INSERT INTO `newzs` (`id`, `title`, `description`, `body`, `img`, `user_id`, `created_at`, `updated_at`) VALUES
(3, 'Как получить промокод Яндекс Директ', 'Чтобы воспользоваться бонусом, необходимо', 'Чтобы воспользоваться бонусом, необходимо выполнить ряд условий.\r\n\r\n    Клиент должен быть новым. Это означает, что его домен второго уровня (т.е. домен типа site.by) ранее никогда не рекламировался в Директ либо последний клик по рекламе был более года назад.\r\n    Расход нового клиента за последний календарный месяц должен превысить 100 BYN – это определится на основе статистики в рекламном кабинете. При этом датой запуска будет считается тот день, когда был совершен первый клик. Но здесь есть важный нюанс, который необходимо учитывать. Рассмотрим его на двух примерах.\r\n\r\nРеклама Клиента A начала работать 8 июня, но в течение месяца было израсходовано только 90 BYN. Согласно правилам Яндекса, промокод в этом случае не зачисляется даже после того, как необходимый минимум в 100 BYN будет достигнут. Рекламная кампания Клиента B запустилась 12 июня, а расход за календарный месяц составил 70 BYN, т.е. он также не успел преодолеть необходимый порог. Однако у этого клиенты будут все шансы получить бонус, если в течение июля он открутит рекламу как минимум на 100 BYN.\r\n\r\nТаким образом, если первый клик по рекламе состоялся до 10 числа месяца включительно, то именно этот месяц и будет считаться календарным. В этом случае для получения купонов Яндекс Директ важно открутить рекламу на 100 BYN именно за текущий календарный месяц (иначе промокод не зачислят даже при достижении нужного расхода). Если же клик состоялся после 10 числа месяца, то решение о зачислении бонусной суммы будет приниматься по результатам следующего месяца.\r\nКакими бывают купоны Яндекс Директ\r\n\r\nБонусы для агентских клиентов бывают трех номиналов:\r\n\r\n    100 BYN – зачисляется, если сумма расходов на рекламу в Директе за первый календарный месяц лежит в пределах 100…199,99 BYN;\r\n    200 BYN – при расходе 200…299,99 BYN;\r\n    300 BYN – при расходе более 300 BYN.\r\n\r\nСогласно правилам Яндекс Директ, промокоды зачисляются на аккаунты в течение 10 рабочих дней после того, как агентство предоставит список клиентов, которые соответствуют описанным выше требованиям. Для агентств крайний срок подачи информации – 10 число каждого месяца. Окончательное решение о зачислении бонуса всегда остается за Яндексом. Агентство предоставляет список претендентов на бонус, а далее уже специалисты Директа проверяют, насколько клиент соответствует всем требованиям, и определяют, какую сумму промокода ему зачислить.', , 1, '2018-10-29 08:57:42', '2018-10-29 08:57:42');

