INSERT INTO `tovar` (`id`, `name`, `body`, `price`, `picture`, `category_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Продажа постельного белья', '<p><strong>Целевая страница</strong>&nbsp;(<a href=\"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Английский язык\">англ.</a>&nbsp;<strong>landing page</strong>, также &laquo;посадочная страница&raquo;)&nbsp;&mdash; веб-страница, основной задачей которой является сбор контактных данных целевой аудитории. Используется для усиления эффективности рекламы, увеличения аудитории. Целевая страница обычно содержит информацию о товаре или услуге.</p>\r\n\r\n<p>Переход на целевые страницы часто осуществляется из&nbsp;<a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D0%BC%D0%B5%D0%B4%D0%B8%D0%B0\" title=\"Социальные медиа\">социальных медиа</a>,&nbsp;<a href=\"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%81%D1%81%D1%8B%D0%BB%D0%BA%D0%B0_%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BD%D0%BD%D0%BE%D0%B9_%D0%BF%D0%BE%D1%87%D1%82%D1%8B\" title=\"Рассылка электронной почты\">email-рассылок</a>&nbsp;и рекламных кампаний в&nbsp;<a href=\"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B8%D1%81%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0\" title=\"Поисковая система\">поисковых системах</a>. Главной задачей таких страниц является конвертация посетителя в покупателя или клиента компании, побуждение к целевому действию. Анализ действий пользователей на целевой странице позволяет маркетологам определить успешность рекламы.</p>', '20', '1540834331-0d043fef4c09b0ada954fc9640e3e94f.jpg', 1, '2018-10-29 14:32:12', '2018-10-29 14:32:12', NULL),
