(4, 'Манометры', '<p><strong>Целевая страница</strong>&nbsp;(<a href=\"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Английский язык\">англ.</a>&nbsp;<strong>landing page</strong>, также &laquo;посадочная страница&raquo;)&nbsp;&mdash; веб-страница, основной задачей которой является сбор контактных данных целевой аудитории. Используется для усиления эффективности рекламы, увеличения аудитории. Целевая страница обычно содержит информацию о товаре или услуге.</p>', '13', '1540834766-belenergokip-11-250x350.png', 2, '2018-10-29 14:39:26', '2018-10-29 14:39:26', NULL),
(5, 'Сайт юридической помощи', '<p><strong>Целевая страница</strong>&nbsp;(<a href=\"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Английский язык\">англ.</a>&nbsp;<strong>landing page</strong>, также &laquo;посадочная страница&raquo;)&nbsp;&mdash; веб-страница, основной задачей которой является сбор контактных данных целевой аудитории. Используется для усиления эффективности рекламы, увеличения аудитории. Целевая страница обычно содержит информацию о товаре или услуге.</p>', '11', '1540834820-landing_21_6.jpg', 2, '2018-10-29 14:39:54', '2018-10-29 14:40:21', NULL);

